import React from 'react';
import { StatusBar } from 'expo-status-bar';
import { styles } from './styleApp.js';
import {View, Text, StyleSheet, TouchableOpacity, SafeAreaView, Button} from 'react-native';
import AnimatedTyping from './AnimatedTyping.js';

//Navigation import
import {NavigationContainer} from '@react-navigation/native';
import {createStackNavigator} from '@react-navigation/stack';

//Screen One
const ScreenOne = props => {

  //onPress To Navigate
  const onPress = () => {
    props.navigation.navigate('ScreenTwo');
  };

  return (
    <SafeAreaView style={styles.container}>
        <Text style={styles.Header}>How bad is your music taste?</Text>
        
  
        <img
          style={styles.album_2}
          src={require("./empty_vinyl.png")}
        />
        <Button 
          style={styles.buttomStyle}
          title="Find Out!"
          color={"#000000"}
          onPress={onPress}>
        </Button>
  
        <Text style={styles.bottomTextLeft}>Project by Timotej, Viktor and Merisa</Text>
  
        <StatusBar style="auto" /> 
      </SafeAreaView>
  );
};

class ScreenTwo extends Component {
  constructor(props){
    const next = () => {
      props.navigation.navigate('ScreenThree');
    };
    return (
      <View style={{flex: 1, justifyContent: 'center', alignItems: 'center'}}>
        <Text>Hi i am an AI programmed, to judge your music taste bla bla bla ...{"\n"}{"\n"}</Text>
        <AnimatedTyping text={["Hi i am an AI programmed, to judge your music taste bla bla bla ..."]} />
  
      
  
        <Button 
            style={styles.buttomStyle}
            title="Log in with spotify"
            color={"#000000"}
            onPress={next}>
          </Button>
            
      </View>
    );
  }
}
/*
//Screen Two
const ScreenTwo = props => {

  
};
*/
//Screen Three
const ScreenThree = props => {

  const back = () => {
    props.navigation.navigate('ScreenOne');
  };
  return (
    <View style={{flex: 1, justifyContent: 'center', alignItems: 'center'}}>
      <Text>Screen Three</Text>
      <Button 
          style={styles.buttomStyle}
          title="back"
          color={"#000000"}
          onPress={back}>
        </Button>
    </View>
  );
};

const App = () => {
  const Stack = createStackNavigator();

  return (
    <NavigationContainer>
      <Stack.Navigator
        screenOptions={{
        headerShown: false //nastavljanje headerja
        }}
      >
        <Stack.Screen name="ScreenOne" component={ScreenOne} />
        <Stack.Screen name="ScreenTwo" component={ScreenTwo} />
        <Stack.Screen name="ScreenThree" component={ScreenThree} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
